import React, {Component} from 'react';
import EventList from './EventList/EventList';

class EventfulContainer extends Component {
    constructor(){
        super();
        this.state = {
            events: []
        }
    }

    getEvents = async () => {
        try {
            const events = await fetch('http://api.eventful.com/json/events/search?app_key=GxbLKLQP6ZCw492p&where=38.9072,-77.0369&within=5')
            const eventsJSON = await events.json();
            return eventsJSON

        } catch (err) {
            return err
        }
    }

    componentDidMount () {
        this.getEvents().then((events) => {
          this.setState({events: events})
        }).catch((err) => { 
          console.log(err)
        })
      }


    render() {
        return(
            <div>
                <EventList events= {this.state.events}/> 
            </div>
        )
    }
}

export default EventfulContainer;
